import React from "react";
import Narbar from "../Layout/Narbar/Narbar";
import { Link } from 'react-router-dom';
import Siderbar from '../Layout/Sidebar/Sidebar'

const Home = ({ user }) => {
    console.log(user);
    return (

    <body id="page-top">
        <div id="wrapper">
            <Siderbar></Siderbar>
            <div id="content-wrapper" class="d-flex flex-column">

           
            <div id="content">
                <Narbar></Narbar>
            </div>
            </div>
        </div>
    </body>
    );
};

export default Home;
